		}

		if (_prefabsToCheck.Count <= 0)
			return;
		
		Log.Error($"Validating Prefabs...");

		int prefabCount = _prefabsToCheck.Count;

		var objs = Resources.FindObjectsOfTypeAll<GameObject>();
